  return (
    <Frame 
      className="App"
      width='100%'
      height='600vh'
    >
      <SlideOne />
      <SlideTwo />
      {/* <SlideThree />
      <SlideFour />
      <SlideFive />
      <SlideSix /> */}
    </Frame>
  );
}

export default App;
